    { imageUrl: "BIRTH :", text: "1997.11.09" },
    { imageUrl: "PHONE :", text: "010-5752-3539" },
    { imageUrl: "MAIL :", text: "kws04182@gmail.com" },
  ];

  return (
    <div className="slideWrapper">
      <h1 className="title">{text}</h1>
      <div className="conArea">
        <div className="imgCon">
